import React from "react";

const AutoRoles = () => {
  const autoroles = [
    { on: "Join", role: "Guest" },
    { on: "Level 3", role: "DJ" },
    { on: "Level 10", role: "Semi Admin" },
  ];
  return (
    <div className="w-100 p-4">
      <table className="table borderless w-100">
        <thead>
          <tr>
            <th scope="col">On</th>
            <th scope="col">Role</th>
          </tr>
        </thead>

        <tbody>
          {autoroles.map((x) => {
            return (
              <tr>
                <th scope="row">1</th>
                {Object.keys(x).map((key) => {
                  return <td>{x[key]}</td>;
                })}
              </tr>
            );
          })}
          <tr>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default AutoRoles;
